import { Carousel } from '@trendyol-js/react-carousel';

const ProductCarousel = ({collection}) => {

  return (
    <Carousel>
      {collection && collection.products.map((product) => (
        <div>
          <img src={product.images[0]}/>
        </div>
      ))}
    </Carousel>
  );
};

export default ProductCarousel;
